import React, {useState} from 'react';
import {Link, useNavigate} from 'react-router-dom';
import {FontAwesomeIcon} from '@fortawesome/react-fontawesome'
import {faCartPlus} from '@fortawesome/free-solid-svg-icons'
import VehicleTerm from "../Vehicles/VehicleTerm/VehicleTerm";

const cartPlus = <FontAwesomeIcon icon={faCartPlus}/>


const Cart = (props) => {
    let username = localStorage.getItem("username");
    const [vehicles, setVehicles] = useState(props.cartVehicles);

    return (
        <div>
            <div className="row">
                <h6>{username}'s shopping cart</h6>
            <div>{vehicles.map((vehicle) => {
                    return (
                        <div className="card">
                            <img className="card-img-top" src={vehicle.picture} alt="Card image cap"/>
                                <div className="card-body">
                                    <h5 className="card-title">{vehicle.brand} {vehicle.model}</h5>
                                    <p className="card-text">Price: {vehicle.price} mkd per day</p>
                                </div>
                                <ul className="list-group list-group-flush">
                                    <li className="list-group-item">Color: {vehicle.color} </li>
                                    <li className="list-group-item">Fuel: {vehicle.fuel}</li>
                                    <li className="list-group-item">Year: {vehicle.year}</li>
                                    <li className="list-group-item">Location: {vehicle.location.name}, {vehicle.location.streetName} </li>
                                </ul>
                                <div className="card-body">
                                    <a href="#" className="card-link btn btn-success">Payout</a>
                                    <a href="#" className="card-link btn btn-danger">Remove</a>
                                </div>
                        </div>
                    );
                }
            )}</div>
            </div>
        </div>
    )
}

export default Cart;
